import React from 'react';
import logo from './logo.svg';
import './App.css';


function App() {

let names =  ['vai bello','rcodue','troppo duci']
  return (
  <div >
      <header >
       {names.map(name=> <p> Ciao {name} </p>)}
      </header>
    </div>
  );
}

export default App;
